// App.js or another relevant component
import React from 'react';
import Header from './components/header'; // Import the Header component
import Feed from './components/feed'; // Import the Feed component
import './components/app.css'; // Import your main CSS file

function App() {
  return (
    <div className="App">
      <Header />
      <main className="content">
        {/* Other content on your homepage */}
        <Feed /> {/* Render the Feed component */}
      </main>
    </div>
  );
}

export default App;
